<script>




import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger'; 


gsap.registerPlugin(ScrollTrigger);

    export default {
        name: 'card',

        data()
        {
            return {
                records: [],


            };
        },
//         directives: {
//     scrollSection: {
//       bind(el, binding) {
//         const { duration } = binding.value || { duration: 1 };

//         const tl = gsap.timeline({ paused: true });

//         tl.to(el, {
//           y: () => -window.innerHeight * el.dataset.index,
//           duration,
//           ease: 'power2.out',
//         });

//         el.timeline = tl;
//       },
//     },
//   },

        mounted(){

            this.setupScrollAnimations();

        },

        methods:
        {
               
            setupScrollAnimations() {
      const sections = [this.$refs.heroSection, this.$refs.homeSection, this.$refs.advancedSection];

      sections.forEach((section, index) => {
        const tl = gsap.timeline({ paused: true });
        tl.to(window, { scrollTo: { y: section.offsetTop, autoKill: false }, duration: 1 });

        section.timeline = tl;
      });

      window.addEventListener('wheel', (event) => {
        const deltaY = event.deltaY;
        const currentSectionIndex = sections.findIndex((section) => section.timeline.progress() > 0);

        if (deltaY > 0 && currentSectionIndex < sections.length - 1) {
          sections[currentSectionIndex + 1].timeline.play();
        } else if (deltaY < 0 && currentSectionIndex > 0) {
          sections[currentSectionIndex - 1].timeline.reverse();
        }
      });
    }

        }
        




    }


</script>


